// components/Services.js
import React from 'react';
import './Services.css';

function Services() {
  return (
    <section className="services" id="services">
      <h2>Our Services</h2>
      <div className="service-cards">
        <div className="service-card">
          <h3>Ground Penetrating Radar</h3>
          <p>Advanced GPR technology for real-time disaster assessment.</p>
        </div>
        <div className="service-card">
          <h3>Real-time Monitoring</h3>
          <p>Track and monitor disaster sites with precision.</p>
        </div>
        <div className="service-card">
          <h3>On-Site Support</h3>
          <p>Expert teams ready to assist in disaster situations.</p>
        </div>
        <div className="service-card">
          <h3>Disaster Assistance</h3>
          <p>we bridge the gap between chaos and recovery.</p>
        </div>
      </div>
    </section>
  );
}

export default Services;
